import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles({
  card: {
    maxWidth: 224
  },
  media: {
    height: 224,
    width: 224
  },
  container: {
    padding: '10px 50px',
    display: 'grid',
    gridRowGap: '20px',
    gridTemplateColumns: 'repeat(auto-fit, 224px)'
  }
});
